import React from 'react';
import { listenerCount } from '../../../../serverdb/db';
import './components.css';

const Movie = ({ children }) => {
  return (
    <div className='result-demo'>
      {
        children.map(function(a) {
          return (
            <li>{a}</li>
          );
        })
      }
    </div>
  );
};

export default Movie;
